import { NextApiRequest, NextApiResponse } from "next";

//Nextjs will look for the default export inside api folder and treat them as handler for that route. the default export funciton must be a function with 2 args req and res

export default function getAllEvents(req, res) {
  res.json({ hello: "world", method: req.method });
}
